import "./App.css";
import Three from "./components/Three";
import Merge from "./components/Merge";
import Four from "./components/Four";
import CurrentLocation from "./components/CurrentLocation";
import SearchBar from "./components/SearchBar";



function App() {
  return (
    <>
      <div
        className=" bg-gradient-to-br from-red-100 via-red-200 to-blue-300 shadow-lg m-5 p-8"
        style={{
          boxShadow:
            "0 14px 16px rgba(0, 0, 0, 0.1), 0 11px 13px rgba(0, 0, 0, 0.08)",
        }}
      >
        <SearchBar />
        <CurrentLocation />
        <div className="App flex flex-row bg-red-300">
          <div className="w-1/2 p-4">
            <Merge />
          </div>
          <div className="w-1/2 p-4">
            <Three />
          </div>
        </div>
        <Four />
      </div>
    </>
  );
}

export default App;
